            revert UniswapV3TWAP__PairMismatch();
        }
        return abi.encode(twap, block.timestamp);
    }

    function _sortedCanonical() internal view returns (address a, address b) { a = canonicalExt0; b = canonicalExt1; if (a > b) { (a, b) = (b, a); } }

